import React from 'react';
import './index.css';
import Count from './components/Count';
import Card from './components/Card';

function App() {
    return (
        
        <>  
            {/* Compteur */}
            <div className='App'>
                <Count />
            </div>
            <div className='container'>
                <h2>liste</h2>
                {/* Appel du composant card */}
                <Card user={{
                    name: "toto",
                    age: 30,
                    job: "engineer"
                }}
                />

            </div>
        </>
    )



}

export default App;
